text:
if you are interesting in learning more about technical interviews, here are a couple resources along with a free copy of Cracking the Coding Interview which has 189 questions to help you prep ($39 savings):
• Columbia career page on technical interviews with great links at bottom including brainteasers - <https://www.careereducation.columbia.edu/resources/prepare-software-or-technical-interview>
• Overview of the technical interview process - <https://learntocodewith.me/posts/technical-interview/>
